import React, { useState } from "react";
import { Link } from "react-router-dom";
const SignupPage = () => {
  const [username,setUsername] = useState('');
  const [password,setPassword] = useState('');
  return (
    <section className={`max-container h-96 my-12 flex justify-between`}>
      <div className=""></div>
      <div className="w-[40%] flex flex-col gap-4">
      <h1 className="text-xl font-bold text-orange-500 text-center mb-10">Sign Up</h1>
        <input type="text" placeholder="Username" className="input" onChange={e=>setUsername(e.target.value)}/>
        <input type="password" placeholder="Password" className="input" onChange={e=>setPassword(e.target.ariaValueMax)}/>
        <button className="p-2 bg-orange-500 rounded-lg text-white font-semibold shadow-lg">
          Sign up
        </button>
      <p className="text-center"><span className="text-sm font-medium">Don't have any account? <Link to={'/auth/login'} className="font-semibold text-orange-500">Login</Link></span></p>

      </div>
    </section>
  );
};

export default SignupPage;
